import React, { Component } from "react";
import Filter from '../Filter'

class Material extends Component {

    constructor (props) {
        super(props)
        this.changeFilter = this.changeFilter.bind(this)
        this.filterMaterial = this.filterMaterial.bind(this)
        // this.buildMaterialView = this.buildMaterialView.bind(this)
        this.resetFilter = this.resetFilter.bind(this)
    }

    state = {
        //the 3 first ones are dummy
        ucs: ['Elet', 'LIC', 'LSD', 'AC'],
        acs: ['Informática', 'Eletrónica'],
        types: ['ATB', 'PDS16', 'BreadBoard'],
        material: [
            {
                name: 'ATB_1',
                type: ['ATB'],
                ucs: ['LIC', 'LSD'],
                acs: ['Informática']
            }, {
                name: 'ATB_2',
                type: ['ATB'],
                ucs: ['LIC', 'LSD'],
                acs: ['Informática']
            },
            {
                name: 'PDS16_1',
                type: ['PDS16'],
                ucs: ['AC'],
                acs: ['Informática']
            },
            {
                name: 'PDS16_2',
                type: ['PDS16'],
                ucs: ['AC'],
                acs: ['Informática']
            },
            {
                name: 'BreadBoard_1',
                type: ['BreadBoard'],
                ucs: ['LSD', 'Elet'],
                acs: ['Informática', 'Eletrónica']
            },
            {
                name: 'BreadBoard_2',
                type: ['BreadBoard'],
                ucs: ['LSD', 'Elet'],
                acs: ['Informática', 'Eletrónica']
            }],
        filters: [],
        filtered: null
    }

    filterMaterial(event) {
        event.preventDefault()
        let filtered = null
        const resetButton = document.getElementById("reset_filter")
        resetButton.style.visibility = "hidden"


        if (this.state.filters.length > 0) {
            filtered = this.state.material.reduce((reduced, material) => {
                let flag = false
                for (let i = 0; i < this.state.filters.length; ++i) {
                    const filter = this.state.filters[i]
                    if (!material[filter.type].find(t => t === filter.name)) {
                        flag = false
                        break
                    }
                    else
                        flag = true
                }
                if (flag) {
                    reduced.push(material)
                }
                return reduced
            }, [])


            resetButton.style.visibility = "visible"

        }
        this.setState({ filtered: filtered })

    }

    changeFilter(filter) {
        //o indice esta todo mamado esta a dar -1 nao sei pq 
        let newfilter = [...this.state.filters]
        if (filter.name === 'all') {
            newfilter = newfilter.filter(obj => obj.type != filter.type)
            console.log(newfilter, 'here')
        }
        else {
            const index = newfilter.findIndex(obj => obj.type === filter.type)
            if (index === -1)
                newfilter.push(filter)
            else
                newfilter[index] = filter
        }

        this.setState({ filters: newfilter })
    }

    //TODO: METER OS FILTROS NO URL PORQUE ASSIM SE SE FIZER REFRESH VAI BUSCAR LA
    

    style = {
        display: 'inline-block',
        margin: 10,
        marginBottom: 30
    }

    resetFilter() {
        window.location.reload()
    }

    render() {
        return (
            <div>
                <h2>Material:</h2>
                <form onSubmit={this.filterMaterial} style={{ display: 'center' }}>
                    <div style={this.style}>
                        <Filter changeFilter={this.changeFilter} name="type" title="Tipo" types={this.state.types} />
                    </div>
                    <div style={this.style}>
                        <Filter changeFilter={this.changeFilter} name="ucs" title="UC's" types={this.state.ucs} />
                    </div>
                    <div style={this.style}>
                        <Filter changeFilter={this.changeFilter} name="acs" title="Área Cientifica" types={this.state.acs} />

                    </div>
                    <button type="submit">Filtrar</button>
                    <button id="reset_filter" style={{ ...this.style, visibility: "collapse" }} onClick={this.resetFilter}>Reset</button>
                </form>

                <hr />

                {
                    this.state.filtered === null ?
                        this.state.material.map(m => {
                            return (
                                <h3 key={m.name}>{m.name}</h3>
                            )
                        })
                        :
                        this.state.filtered.map(m => {
                            return (
                                <h3 key={m.name}>{m.name}</h3>
                            )
                        })
                }
            </div>
        )
    }
}
export default Material
